import React from 'react'
import { secondSection } from '../global/Data'

function About() {
    return (
        <section
            className='my-[30px] xl:mt-[100px]'
        >
            <div className='container mx-auto px-20'>

                {/* Each About */}
                <div className='flex flex-row justify-between items-center px-10 py-10 rounded-md shadow-md'>
                    {secondSection.map((item, idx) => {
                        return (
                            <div key={idx} className="flex flex-row items-center space-x-6">
                                <img src={item.icon} />
                                <div >
                                    <div className='font-bold'>{item.title}</div>
                                    <div >{item.subtitle}</div>
                                </div>
                            </div>
                        )
                    })}
                </div>
            </div>
        </section>
    )
}

export default About
